        coeffs[3] = T[2]*T[3]*pow(T[5], 2)*Xpeak[5] + 2*T[2]*pow(T[5], 3)*Xpeak[5] + pow(T[3], 2)*pow(T[5], 2)*Xpeak[5] + 6*T[3]*pow(T[5], 3)*Xpeak[5] + 8*pow(T[5], 4)*Xpeak[5] - Xpeak[1];
        T[4] = findRoot(coeffs, n);
