        coeffs[2] = T[2]*pow(T[4], 2)*T[5]*Xpeak[5] + 3*T[2]*T[4]*pow(T[5], 2)*Xpeak[5] + 2*T[2]*pow(T[5], 3)*Xpeak[5] + 2*pow(T[4], 3)*T[5]*Xpeak[5] + 10*pow(T[4], 2)*pow(T[5], 2)*Xpeak[5] + 16*T[4]*pow(T[5], 3)*Xpeak[5] + 8*pow(T[5], 4)*Xpeak[5] - Xpeak[1];
